import React, {memo, useCallback} from 'react';
import styled from 'styled-components';

const HeaderContainer = styled.div`
    font-family: 'Noto Sans KR', sans-serif;
    background-color: #ff05;
    padding:20px 0;
    position: static;
    width:100%;
    height:auto;

    .navInner{
      max-width:1200px;
      /* background-color: #f60; */
      margin:0 auto;

      .topMenu{
        display: flex;
        justify-content: right;
        align-items: center;
        
        li{
          margin-left:10px;
          font-size:14px;

          &:first-child::after{
            content: "|";
            margin-left:10px;
            color:#555;
          }

          a{
            color:#555;
          }
        }
      }

      .navWrap{
        display: flex;
        align-items: center;
        justify-content: space-between;

        .navItem{
          display: flex;

          .link{
            margin-left:80px;

            a{
              font-size:16px;
            }
          }
        }
      }
    }
`;

const Header = memo(() => {
  
  const onMenuItemOver = useCallback((e) =>{
    e.preventDefault();
    const current = e.currentTarget;

    const index = Array.from(current.parentNode.children).indexOf(current);
    console.log(index);

    const hover = current.querySelector('.navHoverWrap');
    console.log(hover);
    sub.style.maxHeight = hover.scrollHeight + 'px';
    console.log(hover.scrollHeight);
  }, []);

  const onMenuItemOut = useCallback((e) =>{
    e.preventDefault();
    const current = e.currentTarget;
    const hover = current.querySelector('.navHoverWrap');
    hover.style.maxHeight = '0px';
  }, []);

  return (
    <HeaderContainer>
      <div className='navInner'>
        <ul className='topMenu'>
          <li><a href='#'>더본코리아</a></li>
          <li><a href='#'><img src='/img/icon/top-facebook.jpg' alt='facebook-logo' /></a></li>
          <li><a href='#'><img src='/img/icon/top-instagram.jpg' alt='instagram-logo' /></a></li>
        </ul>
        <div className='navWrap'>
          <img src='/img/logo.png' alt='logoImg' className='logoImg' />
          <ul className='navItem'>
            <li className='link' onMouseOver={onMenuItemOver} onMouseOut={onMenuItemOut}>
              <a href='#'>빽다방</a>
              <div className='navHoverWrap'></div>
              </li>
            <li className='link'><a href='#'>메뉴</a></li>
            <li className='link'><a href='#'>소식</a></li>
            <li className='link'><a href='#'>커뮤니티</a></li>
            <li className='link'><a href='#'>매장안내</a></li>
            <li className='link'><a href='#'>창업안내</a></li>
            <li className='link'><a href='#'>고객의 소리</a></li>
          </ul>
        </div>
      </div>
    </HeaderContainer>
  );
});

export default Header;
